  <p class="p"><span data-number="9" data-sid="NUM 33:9" class="v">9</span>And
  they removed from Marah, and came unto Elim: and in Elim <span
  class="add">were</span> twelve fountains of water, and threescore and ten palm
  trees; and they pitched there. </p>
